script: |
  super -f text -I q4991.spq | sort > q4991.out

inputs:
  - name: q4991.spq
    data: |
      SELECT ALL col2 + + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 / - col2 * - 93 BETWEEN + col0 * col1 + - + 84 + col2 AND - 53;
  - name: tab0

outputs:
  - name: q4991.out
    data: |
      198
      20
      94
